import React, {Component} from "react";

class Message extends Component {
    constructor() {
        super()
        this.state = {
            message: ', dude'
        }
    }

    changeMessage() {
        this.state = {
            message: ', dumbass'
        }
    }

    render() {
        return (
            <div>
            <h1>
                Welome{this.state.message}
            </h1>

            <button onClick={() => this.changeMessage()}>Change</button>
            </div>

        ) 
    }
}

export default Message
